import { ArrowBackIosOutlined, ArrowForwardIosOutlined } from '@material-ui/icons'
import React, { useRef, useState } from 'react'
import './List.scss'
import Listitem from '../listitem/Listitem'


const List = () => {
      const[ismoved,setismoved]=useState(false)
      const[slideNumber,setslideNumber] = useState(0)
      const listref = useRef()
     const handelclick =(direction)=>{
           setismoved(true);
        let distance=listref.current.getBoundingClientRect().x-50;
      if(direction==="left" && slideNumber>0){
            setslideNumber(slideNumber-1)
             listref.current.style.transform=`translateX(${230+distance}px)`
          }
          console.log(distance)
           if(direction==="right"&&slideNumber<5){
                 setslideNumber(slideNumber+1)
            listref.current.style.transform=`translateX(${-230+distance}px)`
         }
      
     }
      return (
            <div className="list">
                  <span className="listitle">Continue to watch</span>
                  <div className="wrapper">
                        <ArrowBackIosOutlined className="slidbararrow left" 
                        onClick={()=>handelclick("left")}
                        style={{display: !ismoved && 'none'}} />
                        <div className="container" ref={listref}>
                              <Listitem index={0} url={"data:image/jpeg;base64,"}/>
                              <Listitem index={1} url={"data:image/jpeg;base64,"}/>
                              <Listitem index={2} url={"data:image/jpeg;base64,"}/>
                              <Listitem index={3} url={"data:image/jpeg;base64,"}/>
                              <Listitem index={4} url={"data:image/jpeg;base64,"}/>
                              <Listitem index={5} url={"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRJxGrf8qASNp1nTNrgrvVIwvpDyNtluRWZyA&usqp=CAU"}/>
                              <Listitem index={6} url={"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRBqH2j0qILjLUAOWQYJ9OzJXJdgCXKpAgppg&usqp=CAU"}/>
                              <Listitem index={7} url={"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTFb6pofiQUB_TWLPHZPTWN3PFFvFeZNsnc5w&usqp=CAU"}/>
                              <Listitem index={8} url={"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRwMIVvpSEtuJeN3npaCTtByWxPQUP-QXbdvg&usqp=CAU"}/>
                              <Listitem index={9} url={"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQwtCVAafB_YZ7kSR2z83tG_C1cPmm0fF8ZBg&usqp=CAU"}/>
                              
                              
                              

                              
                              
                             

                        </div>
                        <ArrowForwardIosOutlined className="slidbararrow right" onClick={()=>handelclick("right")}/>
                  </div>
            </div>
      )
}

export default List
